                <th  key={index} className={item.cName}>
                  <Link style={{ display: 'block',
  color: 'black',
 }} to={item.path}>
                    {item.icon}
                    <span>{item.title}</span>
                  </Link>
                </th>
              );
            })}

    
    
  </tr>
  
</table>
      
   
 
  );
}

export default Navbar;
